import { Headers } from "./Headers";
import { Row } from "./Row";
import { Input } from "./Input";
import { Button } from "../Button";
import { useState } from "react";

export const Table = () => {
  const [inputValue, setInputValue] = useState([]);
  const filter = () => {
    return Row.filter((item) => inputValue);
  };
  return (
    <div>
      <Headers />
      <Input />
      <Button onClick={filter()} />
      <Row />
    </div>
  );
};
